import products from '../products'
import { Card, Row, Col } from 'react-bootstrap'

function Homescreen(){
    return(
        <div><h1>Latest Products</h1><hr /><Row />
            {products.map(function(prod){
                return(
                    <Card>
                    <Card.Body>
                        <h1>{prod.title}</h1>
                        <h5>{prod.desc}</h5>
                        <h2>${prod.price}</h2>
                    </Card.Body>
                    </Card>
                )
            })}
        </div>
    )
}

export default Homescreen
